          <img
            src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQtNTZjawTrzSR9R3nQ6JIYhw4wVUVV6xmIBQ&usqp=CAU"
            height="150"
            width="120"
            alt="stuimg"
          />

          <div className="textDetails">
            <h1 style={c}>{`${fname} ${lname}`}</h1>
            <h1>{Roll}</h1>
          </div>

          <div className="status">
            <h1>{status}</h1>
          </div>
        </div>
        <div className="data-show"></div>
      </div>
    );
